import React from 'react';
import Header from '../components/Header';
import Login from '../components/Login';


const MainPage: React.FC = () => {

  return (
    <div>
      <Header />
      <Login />
      <h2>Top Posts</h2>
    </div>
  );
};

export default MainPage;
export {};
